INSERT INTO `news` (`id`, `name`, `image`, `description`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Mùa hè bớt nóng với trà sữa thạch phô-mai', 'eDGVQRKvB4uVTe4bUmD5MtczihPoWXl6mti01Q64.jpg', 'Mùa hè sẽ bớt nóng với món trà sữa thạch fromage (phô-mai) mát lạnh, béo ngậy dai dai cực ngon này! 53 Mùa hè bớt nóng với trà sữa thạch phô mai', '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Mùa hè sẽ bớt nóng với món trà sữa thạch fromage (phô-mai) mát lạnh, béo ngậy dai dai cực ngon này!</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">53 Mùa hè bớt nóng với trà sữa thạch phô mai</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Nguyên liệu:</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">1 gói bột jelly 10gr; 450gr đường; 900ml nước quả; fromage con bò cười.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cách làm:</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Fromage cắt từng khối vuông nhỏ hoặc bạn dùng loại fromage khối vuông nhỏ có bán sẵn. Đặt từng viên fromage vào từng ô trong khay đá. Trộn bột jelly với đường.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Để tạo ra những viên thạch đủ màu bạn sẽ chuẩn bị các loại nước trái cây: ví dụ nước nho ép có màu đỏ, nước cam có màu vàng, nước dừa tươi cho màu trong, nước màu xanh của lá dứa. Căn cứ vào tỉ lệ bột jelly : ml chất lỏng được hướng dẫn trên bao bì túi bột, bạn sẽ chia phần bột jelly với chất lỏng cho hợp lý. Hoà tan bột jelly với nước trái cây, nấu sôi với lửa nhỏ, quậy đều tay.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Rót nước rau câu vào từng khuôn. Để nguội sau đó cho vào tủ lạnh.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Pha trà túi lọc với nước sôi, thêm sữa đặc tùy khẩu vị đến khi có đột ngọt vừa đủ thì bỏ túi trà đi, để trà nguội rồi cất vào ngăn mát tủ lạnh.</span></p><p style=\"margin-bottom: 0px; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Khi dùng bạn rót trà sữa ra ly, thêm thạch fromage và đá viên tùy thích.</span></p>', '2024-05-30 03:06:45', '2024-05-30 03:07:18');

