INSERT INTO `products` (`id`, `name`, `image`, `price`, `sale_price`, `description`, `category_id`, `status`, `hot_product`, `created_at`, `updated_at`) VALUES
(1, 'Sữa đặc nóng', 'kTdwCL9ZouVgv17TxTqJXFaz7cOvJ3SdCkphXo1u.png', 35000.00, 20000.00, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cup cake dâu tây&nbsp;là một trong những món ăn nhẹ, phù hợp với những ly cafe thơm ngon.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Vị của bánh được sử dụng chocolate là chính, ngoài ra được trang trí thêm dâu tây kèm theo.&nbsp;</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">&nbsp;</span><img src=\"data:image/webp;base64,\" data-filename=\"banh2-191d6ea1-2cf0-411c-9599-686cfe75d131.webp\" style=\"width: 50%;\"></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Ngồi trong quán mà vừa được nhâm nhi ly cafe, vừa được thưởng thức những chiếc bánh ngọt ngào như vậy thì còn gì bằng.</span></p><p style=\"margin-bottom: 0px; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">The coffee house rất sẵn sàng chào đón các bạn.</span></p>', 1, 0, 0, '2024-05-27 03:34:14', '2024-05-27 03:34:14');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `sale_price`, `description`, `category_id`, `status`, `hot_product`, `created_at`, `updated_at`) VALUES
(2, 'Sữa tươi nóng', 'YI4HTG8uQHvuy7GL37wzDVZjuyb6jXagUwqs4Z0e.jpg', 35000.00, NULL, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Bạc xỉu vani là nguồn cung cấp vitamin C dồi dào giúp thúc đẩy quá trình giải độc & tăng sức đề kháng cho cơ thể.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Hợp chất Citrus Limonoid có trong Bạc xỉu vani sẽ giúp phòng chống ung thư vú và ung thư phổi.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Ngoài ra Bạc xỉu vani còn giúp tăng cường độ đàn hồi của thành mạch, giúp ngăn ngừa các trường hợp bị xơ vữa động mạch & tăng huyết áp.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Chỉ một ly nước cam tươi có thể cung cấp hơn 50% nhu cầu về vitamin C cho một phụ nữ cần trong ngày.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Bạc xỉu vani còn là nguồn cung cấp phong phú thiamine và folate.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Thiamine tham gia vào quá trình tổng hợp năng lượng, còn folate giúp gia tăng chất lượng máu, chất này cũng đóng vai trò quan trọng cho phụ nữ mang thai hay những người muốn có con vì đóng vai trò quan trọng cho việc ngăn ngừa những khiếm khuyết như bệnh nứt đốt sống ở bào thai (spina-bifida).</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><img src=\"data:image/webp;base64,\" data-filename=\"14-08d33a85-210c-40e2-a9bc-95b03933517e.webp\" style=\"width: 50%;\"><span style=\"box-sizing: inherit; font-size: 10pt;\"><br></span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Thiamine tham gia vào quá trình tổng hợp năng lượng, còn folate giúp gia tăng chất lượng máu, chất này cũng đóng vai trò quan trọng cho phụ nữ mang thai hay những người muốn có con vì đóng vai trò quan trọng cho việc ngăn ngừa những khiếm khuyết như bệnh nứt đốt sống ở bào thai (spina-bifida).</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Với chế độ ăn uống nhiều chất béo và đường, trong cơ thể sẽ hình thành sự sưng viêm để phản ứng lại. Sự sưng viêm này là nguyên nhân gián tiếp dẫn đến sự làm cứng thành mạch máu do sự đọng chất béo, và cũng gây ra bệnh tiểu đường tuýp 2.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\"></span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Mỗi ngày uống Bạc xỉu vani đều đặn sẽ làm giảm sự sưng viêm trong cơ thể.</span></p>', 1, 0, 1, '2024-05-27 03:37:22', '2024-05-27 03:55:48');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `sale_price`, `description`, `category_id`, `status`, `hot_product`, `created_at`, `updated_at`) VALUES
(3, 'Trà ấm việt nam', 'VfGFuG4mSuRHJdADCD7J4jn7bHCu1V8l4TcwffOU.jpg', 25000.00, 20000.00, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Trà sữa chocolate&nbsp;được điểm màu với những hạt sương sa&nbsp;mát lịm. Mỗi ly trà sữa &nbsp;sẽ mang lại cho bạn cảm hứng mỗi ngày</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Hoàn hảo cho đám cưới, tiệc thôi nôi&nbsp;, tiệc sinh nhật, và cho những ai thích màu sắc.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Các teen đã bao giờ nhâm nhi trà sữa sương sa&nbsp;chưa nhỉ.&nbsp;</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Nó là món quà thường được dùng trong các dip đặc biệt như các buổi cắm trại, dã ngoại ngoài trời trời.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Hãy cùng thưởng thức ngay</span></p>', 2, 0, 0, '2024-05-27 03:38:47', '2024-05-27 03:38:47'),
(4, 'Sinh tố bơ', 'mXTj8e8Voif1PRy4NlzcJ6Qqs7bWpA2cqMWa4pix.jpg', 40000.00, 30000.00, '<p><span style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif; font-size: 10pt;\">Giảm cân, đẹp dáng bằng trà xanh và mật ong</span><br style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif; font-size: 10pt;\">Từ lâu, trà xanh được biết đến là thức uống rất có lợi cho sức khỏe, giúp thanh nhiệt, mang lại sự tỉnh táo, giải độc, chống lão hóa,v.v. Bên cạnh đó, trà xanh còn có tác dụng giảm cân rất an toàn và hiệu quả. Cũng từ lâu, chúng ta đã biết tác dụng của mật ong đối với sức khoẻ và làm đẹp.</span><br></p>', 3, 0, 1, '2024-05-27 03:39:28', '2024-05-27 04:10:19');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `sale_price`, `description`, `category_id`, `status`, `hot_product`, `created_at`, `updated_at`) VALUES
(5, 'Sữa chua đánh đá', 'F5N1zvAmnQuKGDyiR4LSDehhSh6cxS0w8cwVWx1Y.webp', 30000.00, NULL, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cupcake nho khô là một trong những món ăn nhẹ, phù hợp với những ly cafe thơm ngon.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Vị của bánh được sử dụng chocolate là chính, ngoài ra được trang trí thêm dâu tây kèm theo. </span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><img src=\"data:image/webp;base64,\" data-filename=\"banh3.webp\" style=\"width: 50%;\"><span style=\"box-sizing: inherit; font-size: 10pt;\"><br></span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Ngồi trong quán mà vừa được nhâm nhi ly cafe, vừa được thưởng thức những chiếc bánh ngọt ngào như vậy thì còn gì bằng.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\"></span></p><p style=\"margin-bottom: 0px; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">The coffee house rất sẵn sàng chào đón các bạn.</span></p>', 4, 0, 1, '2024-05-27 03:40:30', '2024-05-27 04:10:25');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `sale_price`, `description`, `category_id`, `status`, `hot_product`, `created_at`, `updated_at`) VALUES
(6, 'Trà la hán', 'UMeEKm9eJqiSbjMgmyDdLKMtwEcQTZeSmbrKvX98.jpg', 35000.00, 25000.00, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cupcake nho khô là một trong những món ăn nhẹ, phù hợp với những ly cafe thơm ngon.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Vị của bánh được sử dụng chocolate là chính, ngoài ra được trang trí thêm dâu tây kèm theo. </span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\"> </span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\"><img src=\"https://bizweb.dktcdn.net/100/030/566/products/banh3.jpg?v=1448471155973\" alt=\"\" style=\"box-sizing: inherit; max-width: 100%; width: 50%;\"></span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Ngồi trong quán mà vừa được nhâm nhi ly cafe, vừa được thưởng thức những chiếc bánh ngọt ngào như vậy thì còn gì bằng.</span></p><p style=\"margin-bottom: 0px; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, \"Helvetica Neue\", Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">The coffee house rất sẵn sàng chào đón các bạn.</span></p>', 2, 0, 1, '2024-05-27 03:41:29', '2024-05-27 04:10:33'),
(7, 'Sinh tố dâu tây', '0tA134UEVkIZMwjETD215wZ57Wf15bNN195wljFY.jpg', 35000.00, NULL, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Dâu tây kết hợp với chuối, sữa chua và mật ong thành món sinh tố ngon, bổ với nhiều chất xơ, vitamin, chất chống oxy hóa cho bạn hè này.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">dautay Ngọt mát sinh tố dâu tây</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Nguyên liệu:</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Vài quả dâu tây; một quả chuối chín; một hộp sữa chua và một thìa mật ong.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cách làm: Dâu tây bỏ cuống, thái lát.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Chuối chín bóc vỏ, thái lát.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cho dâu tây, chuối, sữa chua và mật ong vào máy xay sinh tố, xay nhuyễn.</span></p><p style=\"margin-bottom: 0px; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Lấy một quả dâu tây đính lên thành cốc trang trí.</span></p>', 3, 0, 1, '2024-05-30 03:10:10', '2024-05-30 03:10:10'),
(8, 'Sữa chua ngon', 'efDlFVkraMirgiuhvgGSu12oAwKOf5g9SG3V9TqA.jpg', 50000.00, 20000.00, '<p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Mùa hè sẽ bớt nóng với món trà sữa thạch fromage (phô-mai) mát lạnh, béo ngậy dai dai cực ngon này!</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">53 Mùa hè bớt nóng với trà sữa thạch phô mai</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Nguyên liệu:</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">1 gói bột jelly 10gr; 450gr đường; 900ml nước quả; fromage con bò cười.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">Cách làm:</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Fromage cắt từng khối vuông nhỏ hoặc bạn dùng loại fromage khối vuông nhỏ có bán sẵn. Đặt từng viên fromage vào từng ô trong khay đá. Trộn bột jelly với đường.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Để tạo ra những viên thạch đủ màu bạn sẽ chuẩn bị các loại nước trái cây: ví dụ nước nho ép có màu đỏ, nước cam có màu vàng, nước dừa tươi cho màu trong, nước màu xanh của lá dứa. Căn cứ vào tỉ lệ bột jelly : ml chất lỏng được hướng dẫn trên bao bì túi bột, bạn sẽ chia phần bột jelly với chất lỏng cho hợp lý. Hoà tan bột jelly với nước trái cây, nấu sôi với lửa nhỏ, quậy đều tay.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Rót nước rau câu vào từng khuôn. Để nguội sau đó cho vào tủ lạnh.</span></p><p style=\"margin-bottom: 1em; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Pha trà túi lọc với nước sôi, thêm sữa đặc tùy khẩu vị đến khi có đột ngọt vừa đủ thì bỏ túi trà đi, để trà nguội rồi cất vào ngăn mát tủ lạnh.</span></p><p style=\"margin-bottom: 0px; box-sizing: inherit; line-height: 1.3; color: rgba(0, 0, 0, 0.87); font-family: Product_Sans, &quot;Helvetica Neue&quot;, Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 10pt;\">– Khi dùng bạn rót trà sữa ra ly, thêm thạch fromage và đá viên tùy thích.</span></p>', 4, 0, 0, '2024-05-30 03:11:20', '2024-05-30 03:11:20');

